  [],\n\t\"revision_timestamp\": \"2015-05-06T20:56:27.817303\",\n\t\"name\": \"innovative-high-temperature-acoustic-liner-development-and-modeling-project\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"The massive acoustic loads produced by launch
  vehicles can detrimentally affect the proper functioning of vehicle components,
  payloads, and launch support structures. The high-velocity and high temperature
  rocket engine exhaust stream mixes with ambient atmosphere to generate intense acoustic
  loads, which account for the majority of structural vibration during launch. Ultramet
  has developed a unique, high temperature material that has demonstrated passive
  broadband sound attenuation over a range of frequencies and can withstand temperatures
  in excess of 1650 C (3000 F). In this project, Ultramet proposes to team with the
  Graduate Program in Acoustics at Pennsylvania State University (PSU) to develop
  and test a scale model to validate the impedance of this novel high temperature
  acoustic liner. An innovative, porous acoustic material will be developed that has
  demonstrated thermal, corrosion, acoustic, and mechanical load resistance at high
  temperatures, and porosity, pore size, pore shape, and material of construction
  will be varied to optimize mechanical and acoustic performance over a wide range
  of frequencies, amplitudes, and gas flow velocities and temperatures. Ultramet and
  PSU will also develop a basic numerical model to aid in the design of an economical
  and efficient liner exhaust duct system.\",\n\t\"license_title\": \"U.S. Government
